if (!doc.containsKey(fieldname)) {
    return
}
if (doc[fieldname].size()>0) {
    def field_value = doc[fieldname].value;
    if (field_value != null) {
        String repo=grok('objects/%{HOSTNAME:repo}').extract(field_value)?.repo;
        if (repo != null) emit(repo); 
        return;
    }
}"}}}

