{
  "name": "sourceTree",
  "source": [
    "sourceRootNode",
    "sourceIsolatedLevel1",
    "sourceIsolatedLevel2",
    "sourceIsolatedLevel3",
    "sourceIsolatedLevel4"  
  ],
  "transform": [
    {
      "type": "stratify",
      "key": "currentNode",
      "parentKey": "parent"
    },
    {
      "type": "pack",
      "field": "value",
      "sort": {"field": "value"},
      "size": [{"signal": "width/2"}, {"signal": "height"}],
      "padding": 100
    } 
  ]
} ,
{
  "name": "destinationTree",
  "source": [
    "destinationRootNode",
    "destinationIsolatedLevel1",
    "destinationIsolatedLevel2",
    "destinationIsolatedLevel3",
    "destinationIsolatedLevel4"  
  ],
  "transform": [
    {
      "type": "stratify",
      "key": "currentNode",
      "parentKey": "parent"
    },
    {
      "type": "pack",
      "field": "value",
      "sort": {"field": "value"},
      "size": [{"signal": "width/2"}, {"signal": "height"}],
      "padding": 100
    } ,
    //Move destination tree to the right
    {
      "type": "formula",
      "as": "x",
      "expr": "datum.x +  width/2"
    }
  ]
},
    {
      name: links
      source: connections
      transform: [
        {
        "type": "aggregate",
        "groupby": [
          "source_ip",
          "destination_ip"
        ],
        "fields": [
          "value"
        ],
        "ops": [
          "sum"
        ],
        "as": [
          "value"
        ]
      },
      //Set min size to see all connections
      {
        "type": "formula",
        "as": "value",
        "expr": "datum.value == 0 ? 1 : datum.value"
      },
      {
        "type": "filter",
        "expr": "datum.value > $minBytesTransferred"
      },
      {
        type: lookup
        from: sourceTree
        key: currentNode
        fields: ["source_ip"]
        as: ["source"]
      },
      {
        type: lookup
        from: destinationTree
        key: currentNode
        fields: ["destination_ip"]
        as: ["target"]
      },
      {"type": "formula", "as": "fbytes", "expr": "datum.value < 1024 ? datum.value + ' B' : (datum.value < 1024 * 1024) ?  format(datum.value / 1024, ',.2f') + ' KB' : (datum.value < 1024 * 1024 * 1024) ? format(datum.value / 1024 / 1024, ',.2f') + ' MB' : (datum.value / 1024 / 1024 / 1024) ? format(datum.value / 1024 / 1024 / 1024, ',.2f') + ' GB' : 'NA'"}

      // calculate SVG link path between source and destination ips
          {
            type: linkpath
            orient: horizontal
            shape: line
            sourceY: {expr: "datum.source.y"}
            sourceX: {expr: "datum.source.x"}
            targetY: {expr: "datum.target.y"}
            targetX: {expr: "datum.target.x"}
         }
      ]
    }
  ]

  "scales": [
    {
      "name": "color",
      "type": "ordinal",
      "domain": {"data": "sourceTree", "field": "type"},
      "range": {"scheme": "category20"}
    },
    {
      name: width
      type: linear
      range: [1,10]
      domain: {data: "links", field: "value"}
    }
  ],

  "marks": [
    {
      "type": "symbol",
      "from": {"data": "sourceTree"},
      "encode": {
        "enter": {
          "shape": {"value": "circle"},
          "fill": {"scale": "color", "field": "type"},
          "tooltip": [
            {"signal": "{'Type': datum.type,'Name': datum.currentNode}"
            }
          ]
        },
        "update": {
          "x": {"signal": "datum.x - 0"},
          "y": {"signal": "datum.y - 0"},
          "size": {"signal": "4 * datum.r * datum.r"},
          "stroke": {"value": "white"},
          "strokeWidth": {"value": 0.5}
        },
        "hover": {
          "stroke": {"value": "red"},
          "strokeWidth": {"value": 2}
        }
      }
    },
    {
      "type": "symbol",
      "from": {"data": "destinationTree"},
      "encode": {
        "enter": {
          "shape": {"value": "circle"},
          "fill": {"scale": "color", "field": "type"},
          "tooltip": [
            {"signal": "{'Type': datum.type,'Name': datum.currentNode}"
            }
          ]
        },
        "update": {
          "x": {"signal": "datum.x"},
          "y": {"signal": "datum.y + 0"},
          "size": {"signal": "4 * datum.r * datum.r"},
          "stroke": {"value": "white"},
          "strokeWidth": {"value": 0.5}
        },
        "hover": {
          "stroke": {"value": "red"},
          "strokeWidth": {"value": 2}
        }
      }
    },
    {
      // draw the connecting line between stacks
      type: path
      name: linksMark
      from: {data: "links"}
      encode: {
        update: { 
          path: {field: "path"}
          strokeWidth: {scale: "width", field: "value"}
          "tooltip": [
            {"signal": "{'Source': datum.source_ip,'Destination': datum.destination_ip,'Bytes':datum.fbytes}"
            }
          ]
        }

      }
    }
  ]
}"}}

{"title":"[GCP] Sankey Source to Destination country (copy 1)","type":"vega","aggs":[],"params":{"spec":"{
  $schema: https://vega.github.io/schema/vega/v3.0.json
  data: [
    {
      // query ES based on the currently selected time range and filter string
      name: rawData
      url: {
        %context%: true
        %timefield%: @timestamp
        index: logs*
        body: {
          size: 0
          aggs: {
            table: {
              composite: {
                size: 10000
                sources: [
                  {
                    stk1: {
                      terms: {field: "gcp.source.vpc.subnetwork_name"}
                    }
                  }
                  {
                    stk2: {
                      terms: {field: "gcp.destination.vpc.subnetwork_name"}
                    }
                  }
                ]
              }
            }
          }
        }
